    false,nt"url": null,nt"notes": "This Data Release contains data from the
    U.S. Geological Survey (USGS) survey of the Oregon outer Continental shelf (OCS)
    Floating Wind Farm Site in 2014. The backscatter intensity data was collected along
    with bathymetry data by USGS during the period from August 20 to September 1, 2014,
    using a Reson 7111 multibeam echosounder. The mapping mission collected bathymetry
    data from about 163 m to 566 m depths on the Oregon outer continental shelf. The
    acquisition was funded by the U.S. Bureau of Ocean Energy Management. Within the
    final imagery, brighter tones indicate higher backscatter intensity, and darker
    tones indicate lower backscatter intensity. The intensity represents a complex interaction
    between the acoustic pulse and the seafloor, as well as characteristics within the
    shallow subsurface, providing a general indication of seafloor texture and composition.
    Backscatter intensity depends on the acoustic source level; the frequency used to
    image the seafloor; the grazing angle; the composition and character of the seafloor,
    including grain size, water content, bulk density, and seafloor roughness; and some
    biological cover. Harder and rougher bottom types such as rocky outcrops or coarse
    sediment typically return stronger intensities (high backscatter, lighter tones),
    whereas softer bottom types such as fine sediment return weaker intensities (low
    backscatter, darker tones).",nt"license_title": null,nt"extras": [{ntt"key":
